import React from 'react';
import { navigation} from '../data';

const NavMobile = () => {
  return <nav>
    <ul className='flex flex-col justify-center items-center'>
      {navigation.map((item, index) => {
        return <li>
          <a href={item.href}>{item.name}</a>
        </li>
      })}
    </ul>
  </nav>;
};

export default NavMobile;
